import React, {Component, Fragment} from 'react';
import instance from '../../services/tokenprovider';

export class AllToDo extends Component{
    constructor(props){
        super(props);
        this.state = {
            todos:[]
        }
    }

    componentDidMount(){
        instance.get('showalltodos')
        .then(responce => {
            const todos = responce.data;
            this.setState({
                todos
            })
        })
    }
    render(){
        return(
            <Fragment>
                <h1></h1>
                <h1> Hello! </h1>
            </Fragment>
        )
    }
}

export default AllToDo;
